import React, { Component } from "react";
import { Col, Container, Row } from "react-bootstrap";

class Footer extends Component {
  render() {
    return (
      <footer>
        <Row>
          <Container>
            <Col lg={4}></Col>
            <Col lg={4}></Col>
            <Col lg={4}></Col>
            <Col lg={4}></Col>
          </Container>
        </Row>
      </footer>
    );
  }
}

export default Footer;
